(aportan seis meses en un ao)','Porcentaje','18.65','Salario','Nada','0000-00-00','No Activo'),(17,'BS-017','Aporte Personal IESS - Temporales Industria Azucarera','Trabajadores temporales de la industria azucarera (aportan seis meses en un ao)','Porcentaje','17.05','Salario','Resta','0000-00-00','No Activo'),(18,'BS-018','Aporte Personal IESS - Maestros y artesanos Autonomos','Maestros de taller y artesanos autnomos, choferes profesionales miembros de alguna organizacin gremial sin relacin de dependcia','Porcentaje','20.50','Salario','Resta','0000-00-00','No Activo'),(19,'BS-019','Aporte Patronal IESS - Afiliacin Voluntaria','Afiliados voluntarios, continuacin voluntaria para afiliados cesantes de los seguros general y especiales, profesionales con ttulo universitario o politcnico, artistas profesionales, trabajadores autnomos e independientes.','Porcentaje','17.50','Salario','Nada','0000-00-00','No Activo'),(20,'BS-020','Dcimo Tercer Sueldo','Art.111.- Derecho a la decimotercera remuneracin.- Los trabajadores tienen derecho a que sus empleadores les paguen, hasta el veinticuatro de diciembre de cada ao, una remuneracin equivalente a la doceava parte de las remuneraciones que hubieren percibido durante el ao calendario.','Cantidad','1.00','Sueldo','Suma','0000-00-00','Activo'),(21,'BS-021','Dcimo Cuarto Sueldo','Art.113.- Decimocuarta remuneracin.- Los trabajadores percibirn, adems, sin perjuicio de todas las remuneraciones a las que actualmente tienen derecho, una bonificacin adicional equivalente a dos salarios mnimos vitales de su respectiva categora ocupacional, que ser pagada en todo el pas, hasta el 15 de septiembre de cada ao.','Cantidad','170.00','Salario','Suma','0000-00-00','Activo'),(22,'BS-022','Fondos de Reserva','Art.196.- Derecho al fondo de reserva.- Todo trabajador que preste servicios por ms de un ao tiene derecho a que el empleador le abone una suma equivalente a un mes de sueldo o salario por cada ao completo posterior al primero de sus servicios. Estas sumas constituirn su fondo de reserva o trabajo capitalizado.','Cantidad','1.00','Salario','Suma','0000-00-00','Activo'),(23,'BS-023','Utilidades','Art. 97.-Participacin  de  trabajadores  en  utilidades de la empresa.-  El  empleador o empresa reconocer en beneficio de sus trabajadores el quince por ciento(15%) de las utilidades lquidas. Este porcentaje se distribuir as: El  diez por ciento (10%) se dividir para los trabajadores de la empresa, sin consideracin a las remuneraciones recibidas por cada uno de llos durante el ao correspondiente al reparto y ser entregado directamente al trabajador. El cinco por ciento (5%) restante ser entregado directamente a los trabajadores de la empresa, en proporcin a sus cargas familiares, entendindose  por  stas al cnyuge, los hijos menores de dieciocho aos y los hijos minusvlidos de cualquier edad. El reparto se har por intermedio de la asociacin mayoritaria de trabajadores de la empresa y en proporcin al nmero de estas cargas familiares,  debidamente acreditadas por el trabajador ante el empleador. De no existir ninguna asociacin, la entrega ser directa.Quienes no hubieren trabajado durante el ao completo, recibirn por tales participaciones la parte proporcional al tiempo de servicios.','Porcentaje','15.00','Utilidades','Suma','0000-00-00','Activo'),(24,'BS-024','Vacaciones','Art.69.-Vacaciones anuales.- Todo trabajador tendr derecho a gozar anualmente de un perodo ininterrumpido de quince das de descanso, includos los das no laborables. Los trabajadores que hubieren prestado servicios por ms de cinco aos en la misma empresa o al mismo empleador, tendrn derecho a gozar adicionalmente de un da de vacaciones por cada uno de los aos excedentes o recibirn en dinero la remuneracin correspondiente a los das excedentes. El trabajador recibir por adelantado la remuneracin correspondiente al perodo de vacaciones. Los trabajadores menores de dieciseis aos tendrn derecho a veinte das de vacaciones y los mayores de dieciseis y menores de dieciocho, lo tendrn a dieciocho das de vacaciones anuales. Los das de vacaciones adicionales por antigedad no excedern de quince, salvo que las partes, mediante contrato individual o colectivo, convinieren en ampliar tal beneficio.','Cantidad','15.00','Sueldo','Suma','0000-00-00','Activo'),(25,'BS-025','Horas Extras','Art. 55.- Remuneracin por horas suplementarias y extraordinarias.- Por convenio escrito entre las partes, la jornada de trabajo podr exceder del lmite fijado en los artculos 47 y 49, siempre que se proceda con autorizacin del Inspector del Trabajo y se observen las siguientes prescripciones: 1a.- Las horas suplementarias no podrn exceder de cuatro en un da, ni de doce en la semana; 2a.- Si tuviere lugar durante el da o hasta las doce de la noche, el empleador pagar la remuneracin correspondiente a cada una de las horas suplementarias con ms un cincuenta por ciento de recargo. Si dichas horas estuvieren comprendidas entre las doce de la noche y las seis de la maana, el trabajador tendr derecho a un ciento por ciento de recargo. Para calcularlo se tomar como base la remuneracin que corresponda a la hora de trabajo diurno; 3a.- En el trabajo a destajo se tomarn en cuenta para el recargo de la remuneracin las unidades de obra ejecutadas durante las horas excedentes de las ocho obligatorias; en tal caso, se aumentar la remuneracin correspondiente a cada unidad en un cincuenta por ciento o en un ciento por ciento, respectivamente, de acuerdo con la regla anterior. Para calcular este recargo, se tomar como base el valor de la unidad de la obra realizada durante el trabajo diurno; y, 4a.- El trabajo que se ejecutare el sbado o el domingo deber ser pagado con el 100% de recargo.','Porcentaje','50.00','Salario','Suma','0000-00-00','Activo'),(26,'BS-026','Horas Suplementarias','Art. 55.- Remuneracin por horas suplementarias y extraordinarias.- Por convenio escrito entre las partes, la jornada de trabajo podr exceder del lmite fijado en los artculos 47 y 49, siempre que se proceda con autorizacin del Inspector del Trabajo y se observen las siguientes prescripciones: 1a.- Las horas suplementarias no podrn exceder de cuatro en un da, ni de doce en la semana; 2a.- Si tuviere lugar durante el da o hasta las doce de la noche, el empleador pagar la remuneracin correspondiente a cada una de las horas suplementarias con ms un cincuenta por ciento de recargo. Si dichas horas estuvieren comprendidas entre las doce de la noche y las seis de la maana, el trabajador tendr derecho a un ciento por ciento de recargo. Para calcularlo se tomar como base la remuneracin que corresponda a la hora de trabajo diurno; 3a.- En el trabajo a destajo se tomarn en cuenta para el recargo de la remuneracin las unidades de obra ejecutadas durante las horas excedentes de las ocho obligatorias; en tal caso, se aumentar la remuneracin correspondiente a cada unidad en un cincuenta por ciento o en un ciento por ciento, respectivamente, de acuerdo con la regla anterior. Para calcular este recargo, se tomar como base el valor de la unidad de la obra realizada durante el trabajo diurno; y, 4a.- El trabajo que se ejecutare el sbado o el domingo deber ser pagado con el 100% de recargo.','Porcentaje','100.00','Salario','Suma','0000-00-00','Activo'),(27,'BS-027','Bonificacin por Desahucio','Art.185.-Bonificaciones  por  desahucio.-  En los casos de terminacin de la relacin laboral por desahucio solicitado por el empleador o por el trabajador, el empleador bonificar al trabajador con el veinticinco por ciento del equivalente a la ltima remuneracin mensual por cada uno de los aos de servicio prestados a la misma empresa o empleador. Mientras transcurra el plazo de treinta das en el caso de la notificacin de terminacin del contrato de que se habla en el inciso anterior pedido por el empleador, y de quince das en el caso del desahucio solicitado por el trabajador, el  Inspector del Trabajo proceder a liquidar el valor que representan las bonificaciones y la notificacin del empleador no tendr efecto alguno si al trmino del plazo no consignare el valor de la liquidacin que se hubiere realizado. Lo dicho no obsta el derecho de percibir las indemnizaciones que por otras disposiciones correspondan al trabajador.','Porcentaje','25.00','Salario','Suma','0000-00-00','Activo'),(28,'BS-028','Desahucio Directivo Trabajadores','Art.187.- Garantas para dirigentes sindicales.- El empleador no puede despedir  intempestivamente ni desahuciar al trabajador miembro de la directiva de la organizacin de trabajadores. Si lo hiciera, le indemnizar con una cantidad equivalente a la remuneracin de un ao, sin perjuicio  de que siga perteneciendo a la directiva hasta la finalizacin del perodo para el cual fue elegido.Esta garanta se extender durante el tiempo en que el dirigente ejerza sus funciones y un ao ms y proteger, por igual, a los dirigentes de las organizaciones constitudas por trabajadores de una misma empresa, como a los de las constitudas por trabajadores de diferentes empresas, siempre que en este ltimo caso el empleador sea notificado,  por medio del Inspector del Trabajo, de la eleccin del dirigente, que trabaje bajo su dependencia. El monto de la indemnizacin mencionada se dividir y entregar por iguales partes a la asociacin a que pertenezca el trabajador y a ste.En caso de que el empleador incurriera en mora de hasta treinta das en el pago, el trabajador podr exigir judicialmente, y si la sentencia fuere condenatoria al empleador, ste deber pagar, adems de la indemnizacin, el recargo del cincuenta por ciento del valor de lla, en beneficio exclusivo del trabajador. El juez retendr, de oficio, y entregar los fondos a sus destinatarios en las proporciones y formas indicadas, as no hubiere intervenido la sociacin en el litigio; pero sta puede disponer que el saldo recaudado se invierta, en todo o en parte, en asistir al dirigente despedido. Sin embargo, el empleador podr dar por terminado el contrato de trabajo por las causales determinadas en el artculo 172.','Porcentaje','1200.00','Salario','Suma','0000-00-00','Activo'),(29,'BS-029','Recargo Desahucio Directivo Trabajadores','Art.187.- Garantas para dirigentes sindicales.- El empleador no puede despedir  intempestivamente ni desahuciar al trabajador miembro de la directiva de la organizacin de trabajadores. Si lo hiciera, le indemnizar con una cantidad equivalente a la remuneracin de un ao, sin perjuicio  de que siga perteneciendo a la directiva hasta la finalizacin del perodo para el cual fue elegido.Esta garanta se extender durante el tiempo en que el dirigente ejerza sus funciones y un ao ms y proteger, por igual, a los dirigentes de las organizaciones constitudas por trabajadores de una misma empresa, como a los de las constitudas por trabajadores de diferentes empresas, siempre que en este ltimo caso el empleador sea notificado,  por medio del Inspector del Trabajo, de la eleccin del dirigente, que trabaje bajo su dependencia. El monto de la indemnizacin mencionada se dividir y entregar por iguales partes a la asociacin a que pertenezca el trabajador y a ste.En caso de que el empleador incurriera en mora de hasta treinta das en el pago, el trabajador podr exigir judicialmente, y si la sentencia fuere condenatoria al empleador, ste deber pagar, adems de la indemnizacin, el recargo del cincuenta por ciento del valor de lla, en beneficio exclusivo del trabajador. El juez retendr, de oficio, y entregar los fondos a sus destinatarios en las proporciones y formas indicadas, as no hubiere intervenido la sociacin en el litigio; pero sta puede disponer que el saldo recaudado se invierta, en todo o en parte, en asistir al dirigente despedido. Sin embargo, el empleador podr dar por terminado el contrato de trabajo por las causales determinadas en el artculo 172.','Porcentaje','50.00','Salario','Suma','0000-00-00','Activo'),(30,'BS-030','Indemnizacin Despido Intempestivo','Art.188.-Indemnizacin por despido intempestivo.- El empleador que despidiere intempestivamente al trabajador, ser condenado a indemnizarlo, de conformidad con el tiempo de servicio y segn la siguiente escala:Hasta tres aos de servicio, con el valor correspondiente a tres meses de remuneracin; y De ms de tres aos, con el valor equivalente a un mes de remuneracin por cada ao de servicio, sin que en ningn caso ese valor exceda de veinte y cinco meses de remuneracin. La fraccin de un ao se considerar como ao completo. El clculo de estas indemnizaciones se har en base a la remuneracin que hubiere estado percibiendo el trabajador al momento del despido, sin perjuicio de pagar las bonificaciones a las que se alude en el caso del artculo 185, de este Cdigo. Si el trabajo fuere a destajo, se fijar la remuneracin mensual a base del promedio percibido por el trabajador en el ao anterior al despido, o durante el tiempo que haya servido si no llegare a un ao. En el caso del trabajador que hubiere cumplido veinte aos, y menos de veinte y cinco aos de trabajo, continuada o interrumpidamente, adicionalmente tendr derecho a la parte proporcional de la jubilacin patronal, de acuerdo con las normas de este Cdigo. Las indemnizaciones por despido, previstas en este artculo, podrn ser mejoradas por mutuo acuerdo entre las partes, ms no por los Tribunales de Conciliacin y Arbitraje.','Porcentaje','25.00','Salario','Resta','0000-00-00','Activo'),(31,'BS-031','Indemnizacin Plazo Fijo al Empleador','Art.189.-Indemnizacin por despido en contrato a plazo fijo.- En caso de contrato a plazo fijo, el trabajador despedido intempestivamente, podr escoger entre las indemnizaciones determinadas en el artculo precedente o las fijadas en el artculo 181 de este Cdigo.','Porcentaje','50.00','Salario','Suma','0000-00-00','Activo'),(32,'BS-032','Falta de Desahucio Empleado','Art. 190.- Indemnizacin al empleador por falta de desahucio.- El trabajador que sin causa justificada y sin dejar reemplazo aceptado por el empleador, abandonare intempestivamente el trabajo, es decir sin previo desahucio, pagar al empleador una suma equivalente a quince das de la remuneracin.','Porcentaje','50.00','Salario','Resta','0000-00-00','Activo'),(34,'0000033','ANTIGUEDAD','CALCULO DE ANTIGUEDAD','CANTIDAD','2.00','SUELDO','NADA','2008-12-31','ACTIVO');
